import React, { useState } from "react";
import Header from "../../../component/header";
import { TextField, withStyles, CircularProgress } from "@material-ui/core";
import { findById, editUnitById } from "../../../action/units";
import { connect } from "react-redux";
import { Container, Confirm } from "semantic-ui-react";
import styles from "./styles";
import Snackbar from "@material-ui/core/Snackbar";
import Alert from "@material-ui/lab/Alert";
import "./Confirm.css";
import UnitPageList from "../UnitPageList";
import { Button, Modal, ModalHeader, ModalBody, ModalFooter } from "reactstrap";

export class UnitPage extends Component {
  constructor(props) {
    super(props);
    const { match } = this.props;
    this.state = {
      id: match.params.id,
      name: "",
      error: false,
      open: false
    };
  }

  handleButtonClick = () => this.setState({ open: true });
  handleConfirm = () => this.setState({ open: false });
  handleCancel = () => this.setState({ open: false });

  componentDidEdit() {
    const { id } = this.state;
    if (id) {
    }
  }

  componentDidMount() {
    const { id } = this.state;
    if (id) {
      this.props.findById(id);
    }
  }

  componentDidUpdate(prevProps, prevState) {
    const { data, error } = this.props;
    if (prevProps.data != data) {
      this.setState({ ...data });
    } else if (error && prevProps.error !== error) {
      this.setState({ error: true });
    }
  }

  onChange = event => {
    const { name, value } = event.target;
    this.setState({ [name]: value });
  };

  onSubmit = event => {
    event.preventDefault();
    console.log(this.state);
  };

  render() {
    const { classes, error, loading } = this.props;
    const { id, name } = this.state;
    const [modal, setModal] = useState(false);
    const toggle = () => setModal(!modal);
    return (
      <div>
        <Header>
          <Container>
            {!loading ? (
              <form noValidate autoComplete="off" onSubmit={this.onSubmit}>
                {id && (
                  <div className={classes.formField}>
                    <TextField
                      id="id"
                      label="ID"
                      value={id}
                      name="id"
                      variant="filled"
                      inputProps={{ readOnly: true }}
                    />
                  </div>
                )}
                <div className={classes.formField}>
                  <TextField
                    id="name"
                    label="Name"
                    value={name}
                    name="name"
                    variant="filled"
                    onChange={this.onChange}
                    fullWidth
                  />
                </div>
                <div className={classes.buttonContainer}>
                  <Button color="danger" onClick={toggle}>
                    <i class="save icon"></i>
                    Save
                  </Button>
                  <Modal isOpen={modal} toggle={toggle} className={className}>
                    <ModalHeader toggle={toggle}>Modal title</ModalHeader>
                    <ModalBody></ModalBody>
                    <ModalFooter>
                      <Button color="primary" onClick={toggle}>
                        Do Something
                      </Button>{" "}
                    </ModalFooter>
                  </Modal>
                </div>
              </form>
            ) : (
              <CircularProgress />
            )}
            <Snackbar
              open={this.state.error}
              autoHideDuration={1000}
              onClose={() => this.setState({ error: false })}
            >
              <Alert
                onClose={() => this.setState({ error: false })}
                elevation={6}
                variant="filled"
                severity="error"
              >
                {error?.message}
              </Alert>
            </Snackbar>
          </Container>
        </Header>
      </div>
    );
  }
}

const mapStateToProps = state => ({
  data: state.findUnitById.data,
  loading: state.findUnitById.loading || state.editUnitById.loading,
  error: state.findUnitById.error,
  editData: state.editUnitById.data,
  editError: state.editUnitById.error
});

const mapDispatchToProps = {
  findById,
  editUnitById
};

export default withStyles(styles, { withTheme: true })(
  connect(mapStateToProps, mapDispatchToProps)(UnitPage)
);
